INSERT INTO SYS_BO_LIST (ID_, SOL_ID_, NAME_, KEY_, DESCP_, ID_FIELD_, TEXT_FIELD_, PARENT_FIELD_, IS_TREE_DLG_, ONLY_SEL_LEAF_, URL_, MULTI_SELECT_, IS_LEFT_TREE_, LEFT_NAV_, LEFT_TREE_JSON_, SQL_, USE_COND_SQL_, COND_SQLS_, DB_AS_, FIELDS_JSON_, COLS_JSON_, LIST_HTML_, SEARCH_JSON_, BPM_SOL_ID_, FORM_ALIAS_, TOP_BTNS_JSON_, BODY_SCRIPT_, IS_DIALOG_, IS_PAGE_, IS_EXPORT_, HEIGHT_, WIDTH_, ENABLE_FLOW_, IS_GEN_, TENANT_ID_, CREATE_BY_, CREATE_TIME_, UPDATE_BY_, UPDATE_TIME_, IS_SHARE_, TREE_ID_, DRAW_CELL_SCRIPT_, MOBILE_HTML_, DATA_STYLE_, ROW_EDIT_) VALUES ('2400000000001017', NULL, '数据源对话框', 'dataSourceDialog', '', 'ID_', '', '', NULL, NULL, '', 'false', 'NO', '', '', 'select * from sys_datasource_def', 'NO', '[]', '', '[{\"isReturn\":null,\"field\":\"ID_\",\"dataType\":\"string\",\"queryDataType\":\"S\",\"width\":100,\"header\":\"主键\",\"_id\":6,\"_uid\":6},{\"isReturn\":\"YES\",\"field\":\"NAME_\",\"dataType\":\"string\",\"queryDataType\":\"S\",\"width\":100,\"header\":\"数据源名称\",\"_id\":7,\"_uid\":7},{\"isReturn\":\"YES\",\"field\":\"ALIAS_\",\"dataType\":\"string\",\"queryDataType\":\"S\",\"width\":100,\"header\":\"别名\",\"_id\":8,\"_uid\":8},{\"isReturn\":null,\"field\":\"ENABLE_\",\"dataType\":\"string\",\"queryDataType\":\"S\",\"width\":100,\"header\":\"是否使用\",\"_id\":9,\"_uid\":9},{\"isReturn\":null,\"field\":\"SETTING_\",\"dataType\":\"string\",\"queryDataType\":\"S\",\"width\":100,\"header\":\"数据源设定\",\"_id\":10,\"_uid\":10},{\"isReturn\":\"YES\",\"field\":\"DB_TYPE_\",\"dataType\":\"string\",\"queryDataType\":\"S\",\"width\":100,\"header\":\"数据库类型\",\"_id\":11,\"_uid\":11},{\"isReturn\":null,\"field\":\"INIT_ON_START_\",\"dataType\":\"string\",\"queryDataType\":\"S\",\"width\":100,\"header\":\"启动时初始化\",\"_id\":12,\"_uid\":12},{\"isReturn\":null,\"field\":\"CREATE_TIME_\",\"dataType\":\"date\",\"queryDataType\":\"D\",\"format\":\"yyyy-MM-dd\",\"width\":100,\"header\":\"创建时间\",\"_id\":13,\"_uid\":13},{\"isReturn\":null,\"field\":\"CREATE_BY_\",\"dataType\":\"string\",\"queryDataType\":\"S\",\"width\":100,\"header\":\"创建人\",\"_id\":14,\"_uid\":14},{\"isReturn\":null,\"field\":\"UPDATE_BY_\",\"dataType\":\"string\",\"queryDataType\":\"S\",\"width\":100,\"header\":\"更新人\",\"_id\":15,\"_uid\":15},{\"isReturn\":null,\"field\":\"UPDATE_TIME_\",\"dataType\":\"date\",\"queryDataType\":\"D\",\"format\":\"yyyy-MM-dd\",\"width\":100,\"header\":\"更新时间\",\"_id\":16,\"_uid\":16}]', '[{\"_pid\":-1,\"expanded\":true,\"field\":\"NAME_\",\"queryDataType\":\"S\",\"dataType\":\"string\",\"width\":100,\"_level\":0,\"header\":\"数据源名称\",\"_id\":3,\"_uid\":3},{\"_pid\":-1,\"expanded\":true,\"field\":\"ALIAS_\",\"queryDataType\":\"S\",\"dataType\":\"string\",\"width\":100,\"_level\":0,\"header\":\"别名\",\"_id\":4,\"_uid\":4},{\"_pid\":-1,\"expanded\":true,\"field\":\"DB_TYPE_\",\"queryDataType\":\"S\",\"dataType\":\"string\",\"width\":100,\"_level\":0,\"header\":\"数据库类型\",\"_id\":5,\"_uid\":5}]', '<!DOCTYPE html >\r\n<html>\r\n<head>\r\n    <title>数据源对话框</title>\r\n	<script type=\"text/javascript\">\r\n		var __rootPath=\'${ctxPath}\';\r\n	</script>\r\n	<link href=\"${ctxPath}/styles/skin/default/index.css\" rel=\"stylesheet\" type=\"text/css\" /> \r\n	<link href=\"${ctxPath}/styles/commons.css\" rel=\"stylesheet\" type=\"text/css\" />\r\n	<link href=\"${ctxPath}/styles/list.css\" rel=\"stylesheet\" type=\"text/css\" />\r\n	<script src=\"${ctxPath}/scripts/mini/boot.js\" type=\"text/javascript\"></script>\r\n	<script src=\"${ctxPath}/scripts/share.js\" type=\"text/javascript\"></script>\r\n	<link href=\"${ctxPath}/styles/skin/default/index.css\" rel=\"stylesheet\" type=\"text/css\" /> \r\n	<script src=\"${ctxPath}/scripts/common/list.js\" type=\"text/javascript\"></script>\r\n	<script src=\"${ctxPath}/scripts/share/customQuery.js\" type=\"text/javascript\"></script>\r\n	<script src=\"${ctxPath}/scripts/common/form.js\" type=\"text/javascript\"></script>\r\n	<link href=\"${ctxPath}/styles/cover_list.css\" rel=\"stylesheet\" type=\"text/css\" />\r\n		<#assign query=\"\">\r\n		<#if params??&&(params?size>0)>\r\n			<#assign query=\"?\">\r\n			<#assign  keys=params?keys/>\r\n			<#list keys as key>\r\n				<#if (key_index==0)>\r\n					<#assign query=query + key +\"=\" + params[key] >		\r\n				<#else>\r\n					<#assign query=query +\"&\" +key +\"=\" + params[key] >\r\n				</#if>\r\n			</#list>\r\n		</#if>\r\n</head>\r\n<body >   \r\n<div id=\"layout1\" class=\"mini-layout\" style=\"width:100%;height:100%;\">\r\n\r\n      <div region=\"center\"  title=\"数据源对话框\" showCollapseButton=\"false\" >\r\n     	<div class=\"mini-toolbar\" >\r\n	         <table style=\"width:100%;\">\r\n	             <tr>\r\n	                 <td style=\"width:100%;\">\r\n	                    <a class=\"mini-button\" iconCls=\"icon-search\"  onclick=\"onSearch()\">查询</a>\r\n                     	<a class=\"mini-button\" iconCls=\"icon-cancel\"  onclick=\"onClear()\">清空查询</a>\r\n                     	<span class=\"separator\"></span>\r\n                     	<a class=\"mini-button\" iconCls=\"icon-ok\"   onclick=\"CloseWindow(\'ok\');\">确定</a>\r\n		    			<a class=\"mini-button\" iconCls=\"icon-cancel\"  onclick=\"CloseWindow();\">取消</a>\r\n	                 </td>\r\n	             </tr>\r\n	              <tr>\r\n	                  <td  class=\"search-form\" style=\"white-space:nowrap;\">\r\n	                   	<div id=\"searchForm\">\r\n	                    	<div>\n <ul>\n  <li><span>数据源名称</span><input class=\"mini-textbox\" name=\"Q_NAME__S_LK\"></li>\n  <li><span>数据源名称</span><input class=\"mini-textbox\" name=\"Q_NAME__S_LK\"></li>\n </ul>\n</div>\r\n	                    </div>\r\n	                  </td>\r\n	              </tr>\r\n	         </table>\r\n	     </div>\r\n	    \r\n     	<div class=\"mini-fit rx-grid-fit\">\r\n			<div id=\"datagrid1\" class=\"mini-datagrid\" style=\"width: 100%; height: 100%;\" allowResize=\"false\" \r\n	        	url=\"${ctxPath}/dev/cus/customData/dataSourceDialog/getData.do${query}\" idField=\"ID_\" multiSelect=\"false\" showColumnsMenu=\"true\" \r\n	        	parentField=\"\" treeColumn=\"\" allowResize=\"false\" expandOnLoad=\"true\"\r\n	        	sizeList=\"[5,10,20,50,100,200,500]\" pageSize=\"20\" allowAlternating=\"true\">\r\n						<div property=\"columns\">\n <div type=\"indexcolumn\"></div>\n <div type=\"checkcolumn\"></div>\n <div header=\"数据源名称\" width=\"100\" field=\"NAME_\" name=\"NAME_\"></div>\n <div header=\"别名\" width=\"100\" field=\"ALIAS_\" name=\"ALIAS_\"></div>\n <div header=\"数据库类型\" width=\"100\" field=\"DB_TYPE_\" name=\"DB_TYPE_\"></div>\n</div>\r\n			</div>\r\n		</div>\r\n    </div>\r\n</div>\r\n\r\n    \r\n    <script type=\"text/javascript\">\r\n        mini.parse();\r\n		var grid=mini.get(\'datagrid1\');\r\n		grid.load();\r\n		var searchForm=new mini.Form(\'searchForm\');\r\n			\r\n		function onSearch(){\r\n			var data=searchForm.getData();\r\n			_ConvertFormData(data);\r\n			grid.load(data);\r\n		}\r\n		\r\n		//---------------开始生成服务器自定义按钮-------------\r\n		 //-------------结束生成服务器自定义按钮-------------\r\n		\r\n		 grid.on(\"drawcell\", function (e) {\r\n		   var record = e.record,\r\n		   field = e.field,\r\n		   value = e.value;\r\n		   if(field==\'CREATE_BY_\' || field==\'UPDATE_BY_\' || field==\'CREATE_USER_ID_\'){\r\n		     if(value){\r\n		     	e.cellHtml=\'<a class=\"mini-user\" iconCls=\"icon-user\" userId=\"\'+value+\'\"></a>\';\r\n		     }else{\r\n		     	e.cellHtml=\'<span style=\"color:red\">无</span>\';\r\n		     }\r\n		   }\r\n            \r\n            if( field== \"INST_STATUS_\"){\r\n            	var statusText=\"\";\r\n            	if(value==\'RUNNING\'){\r\n            		e.cellHtml=\'<span style=\"color:green\">运行中</span>\';\r\n            	}else if(value==\'DRAFTED\'){\r\n            		e.cellHtml=\'<span style=\"color:red\">草稿</span>\';\r\n            	}else if(value==\'SUCCESS_END\'){\r\n            		e.cellHtml=\'<span style=\"color:green\">成功结束</span>\';\r\n            	}else if(value==\'DISCARD_END\'){\r\n            		e.cellHtml=\'<span style=\"color:red\">作废</span>\';\r\n            	}else if(value==\'ABORT_END\'){\r\n            		e.cellHtml=\'<span style=\"color:red\">异常中止结束</span>\';\r\n            	}else if(value==\'PENDING\'){\r\n            		e.cellHtml=\'挂起\';\r\n            	}else{\r\n            		e.cellHtml=e.value;\r\n            	}\r\n            }\r\n            \r\n            \r\n            \r\n		 });\r\n		\r\n		 grid.on(\'update\',function(){\r\n		   _LoadUserInfo();\r\n		 });\r\n		  \r\n		 grid.on(\'rowdblclick\',function(e){\r\n		 	if(\'\'==\'\'){\r\n				return ;\r\n			}\r\n			var record=e.record;\r\n			\r\n			if(record==null){\r\n			   alert(\'请选择表格行\');\r\n			   return;\r\n			}\r\n			\r\n		   _OpenWindow({\r\n				title:\'数据源对话框--明细\',\r\n				height:400,\r\n				width:800,\r\n				max:true,\r\n				url:__rootPath+\'/sys/customform/sysCustomFormSetting/detail//\'+record.ID_+\'.do\',\r\n				ondestroy:function(action){\r\n					if(action!=\'ok\'){\r\n						return;\r\n					}\r\n				}\r\n			});\r\n		 });\r\n		 \r\n		function getUrlFromRecord(url,record){\r\n		\r\n            url=url.replace(\'{ctxPath}\',__rootPath);\r\n            for(var field in record){\r\n            	url=url.replace(\'{\'+field+\'}\',record[field]);\r\n            }\r\n            return url;\r\n		}\r\n		\r\n		function onClear(){\r\n			searchForm.clear();\r\n			var url=grid.getUrl();\r\n			var index=url.indexOf(\'?\');\r\n			if(index!=-1){\r\n				url=url.substring(0,index);\r\n			}\r\n			grid.setUrl(url);\r\n			grid.load();\r\n		}\r\n		\r\n		function onClose(){\r\n			CloseWindow();\r\n		}\r\n		\r\n		function onRemove(e){\r\n			var row=grid.getSelecteds();\r\n			if(row.length==0){\r\n			   alert(\'请选择表格行\');\r\n			   return;\r\n			}\r\n			\r\n			var url=\"/sys/customform/sysCustomFormSetting/remove/.do\";\r\n			if(e.sender && e.sender.url){\r\n				url=e.sender.url;\r\n			}\r\n			url=__rootPath+url;\r\n			mini.confirm(\"确定删除吗?\", \"提示信息\", function(action){\r\n                if (action != \"ok\")  return;\r\n				var ids = [];\r\n				for(var i=0; i < row.length; i++){\r\n					ids.push(row[i][\'ID_\']);\r\n				}\r\n				_SubmitJson({url:url,method:\"POST\",data:{id:ids.join(\',\')},success:function(){\r\n					grid.load();\r\n				}})    \r\n            })\r\n		}\r\n		\r\n		//返回选择的数据\r\n		function getData(){\r\n			var rows=grid.getSelecteds();\r\n			return rows;\r\n		}\r\n		\r\n		function showLink(value,field,url,linkType){\r\n			if(linkType==\'tabWindow\'){\r\n				top[\'index\'].showTabFromPage({\r\n        			tabId:\'_\'+field,\r\n        			title:value + \'-信息\',\r\n        			url:url\r\n        		});\r\n			}else if(linkType==\"newWindow\"){\r\n				 window.open(url); \r\n			}else{\r\n				 _OpenWindow({\r\n					title:value,\r\n					height:400,\r\n					width:800,\r\n					max:true,\r\n					url:url\r\n				});\r\n			}\r\n		}\r\n    </script>\r\n\r\n</body>\r\n</html>', '[{\"fc\":\"mini-textbox\",\"_id\":1,\"_uid\":1,\"_state\":\"added\",\"fieldLabel\":\"数据源名称\",\"dataType\":\"string\",\"queryDataType\":\"S\",\"fieldName\":\"NAME_\",\"fieldOpLabel\":\"%模糊匹配%\",\"fieldOp\":\"LK\",\"fcName\":\"文本框\",\"fieldText\":\"数据源名称\",\"type\":\"query\",\"typeName\":\"查询参数\",\"autoFilter\":\"YES\",\"autoFilterName\":\"是\"},{\"fc\":\"mini-textbox\",\"_id\":2,\"_uid\":2,\"_state\":\"added\",\"fieldLabel\":\"数据源名称\",\"dataType\":\"string\",\"queryDataType\":\"S\",\"fieldName\":\"NAME_\",\"fieldOpLabel\":\"%模糊匹配%\",\"fieldOp\":\"LK\",\"fcName\":\"文本框\",\"fieldText\":\"数据源名称\",\"type\":\"query\",\"typeName\":\"查询参数\",\"autoFilter\":\"YES\",\"autoFilterName\":\"是\"}]', '', '', '', '', 'YES', 'YES', '', 600, 800, '', 'YES', '1', '1', NULL, NULL, NULL, 'NO', NULL, '', '\r\n\r\n<yd-layout>\r\n	<yd-navbar slot=\"navbar\" title=\"数据源对话框\">\r\n      <a href=\"javascript:;\" v-on:click=\"goBack\" slot=\"left\">\r\n        <yd-navbar-back-icon></yd-navbar-back-icon>\r\n      </a>\r\n    </yd-navbar>\r\n    <rx-search slot=\"top\" v-model=\"search.Q_NAME__S_LK\" v-on:input=\"handSearch\"  :senior=\"true\"  v-on:showsenior=\"showSenior()\"  ></rx-search>\r\n    <!--参数-->\r\n    <rx-searchpanel v-on:search=\"handSearch\" ref=\"searchPanel\" >\r\n    	<div class=\"search-params\">\r\n    		<div class=\"title\">\r\n    			数据源名称\r\n    		</div>\r\n    		<div class=\"content\">\r\n    				<input  v-model=\"search.Q_NAME__S_LK\"  placeholder=\"请输入数据源名称\"/>\r\n    		</div>\r\n    	</div>\r\n    	<div class=\"search-params\">\r\n    		<div class=\"title\">\r\n    			数据源名称\r\n    		</div>\r\n    		<div class=\"content\">\r\n    				<input  v-model=\"search.Q_NAME__S_LK\"  placeholder=\"请输入数据源名称\"/>\r\n    		</div>\r\n    	</div>\r\n    </rx-searchpanel>\r\n    <!-- 列表字段 -->\r\n    <yd-pullrefresh :on-infinite=\"loadList\" ref=\"pullrefreshList_\">\r\n    		<div v-for=\"item in list\" v-if=\"list && list.length>0\" class=\"custom-list\">\r\n    			<div class=\"head\"   v-on:click=\"toggle(item)\"  >\r\n    				\r\n					<div class=\"head-content\">\r\n							<rx-radio name=\"selectId\" :val=\"item.ID_\" v-model=\"selectIds\">{{item.NAME_}}</rx-radio>\r\n					</div>\r\n	    			\r\n	    			<i  v-bind:class=\"{ rotated: item.expand }\"></i>\r\n	    		</div>\r\n	    		<div class=\"body\" v-show=\"item.expand\">\r\n	\r\n	    						<div class=\"body-item\">\r\n		    						<div class=\"title\">别名</div>\r\n			    					<div class=\"content\">\r\n			    						{{item.ALIAS_}}\r\n			    					</div>	\r\n		    					</div>\r\n	\r\n	    						<div class=\"body-item\">\r\n		    						<div class=\"title\">数据库类型</div>\r\n			    					<div class=\"content\">\r\n			    						{{item.DB_TYPE_}}\r\n			    					</div>	\r\n		    					</div>\r\n	\r\n	    		</div>\r\n    		</div>\r\n    </yd-pullrefresh>\r\n	<rx-nodata :amount=\"list.length\"></rx-nodata>\r\n	\r\n	<yd-tabbar slot=\"tabbar\">\r\n		<tabbar-item title=\"确定\" name=\"btnOk\" type=\"a\" v-on:handclick=\"clickOk()\"  icon=\"yd-icon-ok\" active=\"true\"></tabbar-item>\r\n		<tabbar-item title=\"取消\" name=\"btnClose\" type=\"a\" v-on:handclick=\"clickClose()\"  icon=\"yd-icon-close\" ></tabbar-item>\r\n	</yd-tabbar>\r\n	\r\n</yd-layout>\r\n<script>\r\n//参数\r\nvar params_json={\r\n	search:{\r\n			\"Q_NAME__S_LK\":\"\",\r\n			\"Q_NAME__S_LK\":\"\"\r\n	},\r\n	result:[\"NAME_\",\"ALIAS_\",\"DB_TYPE_\"]\r\n};\r\n\r\n</script>', 'list', '');
INSERT INTO INS_COLUMN_DEF (COL_ID_, NAME_, KEY_, DATA_URL_, IS_DEFAULT_, TEMPLET_, FUNCTION_, IS_NEWS_, TENANT_ID_, CREATE_BY_, CREATE_TIME_, UPDATE_BY_, UPDATE_TIME_) VALUES ('2400000003411003', '消息盒', 'msgBox', '1', '1', '<div id=\"msgBox\" class=\"colId_${colId}\" colId=\"${colId}\">\r\n	<div class=\"card\">\r\n		<ul id=\"cardUl\">\r\n			<#list data.obj as d>\r\n			<li class=\"p_top\">\r\n            	<a href=\"${ctxPath}${d.url}\" target=\"_blank\">\r\n					<div class=\"cardBox\" url=\"${ctxPath}${d.url}\">\r\n						<span class=\"iconfont  ${d.icon}\"></span> \r\n						<span class=\"card_text\">\r\n							<h3>${d.count}</h3>\r\n							<h2>${d.title}</h2>\r\n						</span>\r\n						<div class=\"clearfix\"></div>\r\n					</div>\r\n                </a>\r\n			</li>\r\n			</#list>\r\n			<h1 class=\"clearfix\"></h1>\r\n		</ul>\r\n	</div>\r\n</div>', 'portalScript.getPortalMsgBox(\"msgbox\")', 'NO', '1', '1', NULL, NULL, NULL);
INSERT INTO INS_COLUMN_DEF (COL_ID_, NAME_, KEY_, DATA_URL_, IS_DEFAULT_, TEMPLET_, FUNCTION_, IS_NEWS_, TENANT_ID_, CREATE_BY_, CREATE_TIME_, UPDATE_BY_, UPDATE_TIME_) VALUES ('2400000003411004', '待办列表', 'BpmTask', '/bpm/core/bpmTask/myList.do', '1', '<div id=\"myTask\" class=\"colId_${colId}\" colId=\"${colId}\">\r\n	<div class=\"widget-box border \" >\r\n		<div class=\"widget-body\">\r\n			<div class=\"widget-scroller\" >\r\n				<dl class=\"modularBox\">\r\n					<dt>\r\n						<h1>${data.title}</h1>\r\n						<div class=\"icon\">\r\n							<input type=\"button\" id=\"More\" onclick=\"showMore(\'${colId}\',\'${data.title}\',\'${data.url}\')\"/>\r\n							<input type=\"button\" id=\"Refresh\" onclick=\"refresh(\'${colId}\')\"/>\r\n						</div>\r\n						<div class=\"clearfix\"></div>\r\n					</dt>\r\n					<dd id=\"modularTitle\">\r\n						<span class=\"project_01\">\r\n							<p>审批环节</p>\r\n						</span>\r\n						<span class=\"project_02\">\r\n							<p>事项</p>\r\n						</span>\r\n						<span class=\"project_03\">\r\n							<p>日期</p>\r\n						</span>\r\n						<span class=\"project_04\">\r\n							<p>操作</p>\r\n						</span>\r\n						<div class=\"clearfix\"></div>\r\n					</dd>\r\n					<#list data.obj as obj>\r\n						<dd>\r\n							<span class=\"project_01\">\r\n								<a href=\"###\">${obj.name}</a>\r\n							</span>\r\n							<span class=\"project_02\">\r\n								<a href=\"${ctxPath}/bpm/core/bpmTask/toStart.do?fromMgr=true&taskId=${obj.id}\" target=\"_blank\">${obj.description}</a>\r\n							</span>\r\n							<span class=\"project_03\">\r\n								<a href=\"###\">${obj.createTime?string(\'yyyy-MM-dd\')}</a>\r\n							</span>\r\n							<span class=\"project_04\">\r\n								<a href=\"${ctxPath}/bpm/core/bpmTask/toStart.do?fromMgr=true&taskId=${obj.id}\" target=\"_blank\">操作</a>\r\n							</span>\r\n							<div class=\"clearfix\"></div>\r\n						</dd>\r\n					</#list>\r\n				</dl>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>', 'portalScript.getPortalBpmTask(colId)', 'NO', '1', '1', NULL, NULL, NULL);
INSERT INTO INS_COLUMN_DEF (COL_ID_, NAME_, KEY_, DATA_URL_, IS_DEFAULT_, TEMPLET_, FUNCTION_, IS_NEWS_, TENANT_ID_, CREATE_BY_, CREATE_TIME_, UPDATE_BY_, UPDATE_TIME_) VALUES ('2400000004011000', '公司公告', 'news', '1', '1', '<div id=\"news\" class=\"colId_${colId}\" colId=\"${colId}\">\r\n	<div class=\"widget-box border \" >\r\n		<div class=\"widget-body\">\r\n			<div class=\"widget-scroller\" >\r\n				<dl class=\"modularBox\">\r\n					<dt>\r\n						<h1>${data.title}</h1>\r\n						<div class=\"icon\">\r\n							<input type=\"button\" id=\"More\" class=\"p_top\" onclick=\"showMore(\'${colId}\',\'${data.title}\',\'${data.url}\')\"/>\r\n							<input type=\"button\" id=\"Refresh\" class=\"p_top\" onclick=\"refresh(\'${colId}\')\"/>\r\n						</div>\r\n						<div class=\"clearfix\"></div>\r\n					</dt>\r\n						<#list data.obj as obj>\r\n						<dd class=\"p_top\">\r\n							<p><a href=\"${ctxPath}/oa/info/insNews/get.do?permit=no&pkId=${obj.newId}\" target=\"_blank\">${obj.subject}</a></p>\r\n						</dd>\r\n						</#list>\r\n				</dl>\r\n			</div>\r\n		</div>\r\n		<div class=\"Load\">\r\n			<span></span>\r\n			<h1>加载中...</h1>\r\n		</div>\r\n	</div>\r\n</div>', 'portalScript.getPortalNews(colId)', 'YES', '1', '1', NULL, NULL, NULL);
INSERT INTO INS_COLUMN_DEF (COL_ID_, NAME_, KEY_, DATA_URL_, IS_DEFAULT_, TEMPLET_, FUNCTION_, IS_NEWS_, TENANT_ID_, CREATE_BY_, CREATE_TIME_, UPDATE_BY_, UPDATE_TIME_) VALUES ('2400000004021000', '我的消息', 'myMsg', '1', '1', '<div id=\"myMsg\" class=\"colId_${colId}\" colId=\"${colId}\">\r\n	<div class=\"widget-box border \" >\r\n		<div class=\"widget-body\">\r\n			<div class=\"widget-scroller\" >\r\n				<dl class=\"modularBox\">\r\n					<dt>\r\n						<h1>${data.title}</h1>\r\n						<div class=\"icon\">\r\n							<input type=\"button\" id=\"More\" onclick=\"showMore(\'${colId}\',\'${data.title}\',\'${data.url}\')\"/>\r\n							<input type=\"button\" id=\"Refresh\" onclick=\"refresh(\'${colId}\')\"/>\r\n						</div>\r\n						<div class=\"clearfix\"></div>\r\n					</dt>\r\n						<#list data.obj as obj>\r\n						<dd>\r\n							<p><a href=\"${ctxPath}/oa/info/infInbox/recPortalGet.do?pkId=${obj.msgId}\" target=\"_blank\">${obj.content}</a></p>\r\n						</dd>\r\n						</#list>\r\n				</dl>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>', 'portalScript.getPortalMsg(colId)', 'NO', '1', '1', NULL, NULL, NULL);
INSERT INTO INS_COLUMN_DEF (COL_ID_, NAME_, KEY_, DATA_URL_, IS_DEFAULT_, TEMPLET_, FUNCTION_, IS_NEWS_, TENANT_ID_, CREATE_BY_, CREATE_TIME_, UPDATE_BY_, UPDATE_TIME_) VALUES ('2400000004021001', '外部邮件', 'outMail', '1', '1', '<div id=\"outMail\" class=\"colId_${colId}\" colId=\"${colId}\">\r\n	<div class=\"widget-box border \" >\r\n		<div class=\"widget-body\">\r\n			<div class=\"widget-scroller\" >\r\n				<dl class=\"modularBox\">\r\n					<dt>\r\n						<h1>${data.title}</h1>\r\n						<div class=\"icon\">\r\n							<input type=\"button\" id=\"More\" onclick=\"showMore(\'${colId}\',\'${data.title}\',\'${data.url}\')\"/>\r\n							<input type=\"button\" id=\"Refresh\" onclick=\"refresh(\'${colId}\')\"/>\r\n						</div>\r\n						<div class=\"clearfix\"></div>\r\n					</dt>\r\n						<#list data.obj as obj>\r\n						<dd>\r\n							<p><a href=\"${ctxPath}/oa/mail/outMail/get.do?isHome=YES&pkId=${obj.mailId}\" target=\"_blank\">${obj.subject}</a></p>\r\n						</dd>\r\n						</#list>\r\n				</dl>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>', 'portalScript.getPortalOutEmail(colId)', 'NO', '1', '1', NULL, NULL, NULL);
INSERT INTO INS_COLUMN_DEF (COL_ID_, NAME_, KEY_, DATA_URL_, IS_DEFAULT_, TEMPLET_, FUNCTION_, IS_NEWS_, TENANT_ID_, CREATE_BY_, CREATE_TIME_, UPDATE_BY_, UPDATE_TIME_) VALUES ('2400000008039006', '基础信息', 'baseInfo', '', '', '<div id=\"msgBox\" class=\"colId_${colId}\" colId=\"${colId}\">\n	<div class=\"card_msg\">\n		<ul id=\"cardUl\">			\n			<li class=\"p_top\">\n				<div class=\"cardInfo\">\n					<h3>公司违纪举报电话及邮箱</h3>\n					<h2>jichabu@redxun.cn</h2>\n				</div>\n			</li>\n			<li class=\"p_top\">\n				<div class=\"cardInfo\">\n					<h3>总裁办</h3>\n					<h2>020-26404070 13602987111</h2>\n				</div>\n			</li>\n			<li class=\"p_top\">\n				<div class=\"cardInfo\">\n					<h3>总经办</h3>\n					<h2>020-86310367 18023875131</h2>\n				</div>\n			</li>\n			<li class=\"p_top\">\n				<div class=\"cardInfo\">\n					<h3>稽查部</h3>\n					<h2>020-86385980 18023876667</h2>\n				</div>\n			</li>\n			<li class=\"p_top\">\n				<div class=\"cardInfo\">\n					<h3>人事部</h3>\n					<h2>020-86331013 18053769755</h2>\n				</div>\n			</li>\n			<h1 class=\"clearfix\"></h1>\n		</ul>\n	</div>\n</div>', 'portalScript.getPortalMsgBox(\"msgbox\")', 'NO', '1', '1', NULL, NULL, NULL);
INSERT INTO INS_COLUMN_DEF (COL_ID_, NAME_, KEY_, DATA_URL_, IS_DEFAULT_, TEMPLET_, FUNCTION_, IS_NEWS_, TENANT_ID_, CREATE_BY_, CREATE_TIME_, UPDATE_BY_, UPDATE_TIME_) VALUES ('2400000008759000', '柱状报表', 'report', '', '', '<div id=\"report\" class=\"colId_${colId} modularBox\" colId=\"${colId}\" style=\"background: #fff;\">\r\n<div id=\"zzbb\" style=\"width:100%;height:360px;\" ></div>\r\n<div class=\"script\">\r\n <script type=\"text/javascript\">\r\n        // 基于准备好的dom，初始化echarts实例\r\n        var myChart = echarts.init(document.getElementById(\'zzbb\'));\r\n\r\n        // 指定图表的配置项和数据\r\n        var option = {\r\n            title: {\r\n                text: \'本月销量\'\r\n            },\r\n            tooltip: {},\r\n            legend: {\r\n                data:[\'销量\']\r\n            },\r\n            xAxis: {\r\n                data: [\"衬衫\",\"羊毛衫\",\"雪纺衫\",\"裤子\",\"高跟鞋\",\"袜子\"]\r\n            },\r\n            yAxis: {},\r\n            series: [{\r\n                name: \'销量\',\r\n                type: \'bar\',\r\n                data: [5, 20, 36, 10, 10, 20]\r\n            }]\r\n        };\r\n\r\n        // 使用刚指定的配置项和数据显示图表。\r\n        myChart.setOption(option);\r\n    </script>\r\n</div>\r\n</div>', '', 'NO', '1', '1', NULL, NULL, NULL);
INSERT INTO INS_COLUMN_DEF (COL_ID_, NAME_, KEY_, DATA_URL_, IS_DEFAULT_, TEMPLET_, FUNCTION_, IS_NEWS_, TENANT_ID_, CREATE_BY_, CREATE_TIME_, UPDATE_BY_, UPDATE_TIME_) VALUES ('2400000011559002', '折线报表图', 'zxbbt', '', '', '<div id=\"zxbbt\" class=\"colId_${colId} \" colId=\"${colId}\" style=\"background: #fff;\">\r\n<div id=\"zxbbtChart\" style=\"width:100%;height:360px;\" ></div>\r\n<div class=\"script\">\r\n <script type=\"text/javascript\">\r\n        // 基于准备好的dom，初始化echarts实例\r\n        var zxChart = echarts.init(document.getElementById(\'zxbbtChart\'));\r\n\r\n        // 指定图表的配置项和数据\r\n        var option = {\r\n            title: {\r\n                text: \'本月销量\'\r\n            },\r\n            tooltip: {},\r\n            legend: {\r\n                data:[\'销量\']\r\n            },\r\n            xAxis: {\r\n                data: [\"衬衫\",\"羊毛衫\",\"雪纺衫\",\"裤子\",\"高跟鞋\",\"袜子\"]\r\n            },\r\n            yAxis: {},\r\n            series: [{\r\n                name: \'销量\',\r\n                type: \'line\',\r\n                data: [5, 20, 36, 10, 10, 20]\r\n            }]\r\n        };\r\n\r\n        // 使用刚指定的配置项和数据显示图表。\r\n        zxChart.setOption(option);\r\n    </script>\r\n</div>\r\n</div>', '', 'NO', '1', '1', NULL, NULL, NULL);
INSERT INTO INS_COLUMN_DEF (COL_ID_, NAME_, KEY_, DATA_URL_, IS_DEFAULT_, TEMPLET_, FUNCTION_, IS_NEWS_, TENANT_ID_, CREATE_BY_, CREATE_TIME_, UPDATE_BY_, UPDATE_TIME_) VALUES ('2400000011559004', '曲线报表图', 'qxbbt', '', '', '<div id=\"qxbbt\" class=\"colId_${colId}\" colId=\"${colId}\" style=\"background: #fff;\">\r\n<div id=\"qxbbtChart\" style=\"width:100%;height:360px;\" ></div>\r\n<div class=\"script\">\r\n <script type=\"text/javascript\">\r\n        // 基于准备好的dom，初始化echarts实例\r\n        var qxChart = echarts.init(document.getElementById(\'qxbbtChart\'));\r\n\r\n        // 指定图表的配置项和数据\r\n        option = {\r\n    title : {\r\n        text: \'某楼盘销售情况\',\r\n        subtext: \'纯属虚构\'\r\n    },\r\n    tooltip : {\r\n        trigger: \'axis\'\r\n    },\r\n    legend: {\r\n        data:[\'意向\',\'预购\',\'成交\']\r\n    },\r\n    calculable : true,\r\n    xAxis : [\r\n        {\r\n            type : \'category\',\r\n            boundaryGap : false,\r\n            data : [\'周一\',\'周二\',\'周三\',\'周四\',\'周五\',\'周六\',\'周日\']\r\n        }\r\n    ],\r\n    yAxis : [\r\n        {\r\n            type : \'value\'\r\n        }\r\n    ],\r\n    series : [\r\n        {\r\n            name:\'成交\',\r\n            type:\'line\',\r\n            smooth:true,\r\n            itemStyle: {normal: {areaStyle: {type: \'default\'}}},\r\n            data:[10, 12, 21, 54, 260, 830, 710]\r\n        },\r\n        {\r\n            name:\'预购\',\r\n            type:\'line\',\r\n            smooth:true,\r\n            itemStyle: {normal: {areaStyle: {type: \'default\'}}},\r\n            data:[30, 182, 434, 791, 390, 30, 10]\r\n        },\r\n        {\r\n            name:\'意向\',\r\n            type:\'line\',\r\n            smooth:true,\r\n            itemStyle: {normal: {areaStyle: {type: \'default\'}}},\r\n            data:[1320, 1132, 601, 234, 120, 90, 20]\r\n        }\r\n    ]\r\n};\r\n                    \r\n\r\n        // 使用刚指定的配置项和数据显示图表。\r\n        qxChart.setOption(option);\r\n    </script>\r\n</div>\r\n</div>', '', 'NO', '1', '1', NULL, NULL, NULL);
